import React, { Component } from 'react';
import Card from 'react-bootstrap/Card';



class AdvisorInfo extends Component {
    constructor(props) {
        super(props);
        this.state = {
            advisors: []
        }
    }
    render() { 
        var advisor = {AdvisorID: 0, firstName: "ABCD", lastName: "Smith",done: false};
        this.advisors.push(advisor);

        return (
            <Card border="primary">
                <Card.Header>Advisor Information</Card.Header>
                <Card.Body>
                    <Card.Text>
                        <p>Name: {this.state.firstName+" "+this.state.lastName}</p>
                        <p>Major: {this.state.major}</p>
                        <p>Year: {this.state.yearAttend}</p>                        
                    </Card.Text>
                </Card.Body>
            </Card>
        );
    }
}

export default AdvisorInfo;
